        and social care professionals. St George''s provides world-class multi-professional
        health sciences education that equips graduates to meet todays healthcare
        needs through relevant scientific research, clinical excellence, strong interpersonal
        skills and team-based working. Its research institutes focus on biomedical
        and scientific discovery, advancing the prevention and treatment of disease
        in the fields of population health, heart disease and infection - three of
