        has more than 250 years of excellence and innovation in research and education
        resulting in groundbreaking advances in medicine and healthcare. Its alumni
        include Edward Jenner, Muriel Powell and Patrick Steptoe. St George''s students
        come from more than 50 countries, and it has a growing portfolio of international
        collaborations in education and research in Asia, Europe, Africa and the Americas.
