        that operate in greater London (the others include the City of London Police
        and the British Transport Police). The Royal Parks Constabulary have now become
        part of the Metropolitan Police Service. Founded by Sir Robert Peel in 1829,
        the original establishment of 1,000 officers policed a seven-mile radius from
        Charing Cross and a population of less than 2 million. Today, the Metropolitan
        Police Service employs more than 33,000 officers together with about 14,200
        police staff, 270 traffic wardens and 4,700 Police Community Support Officers
